<?php

namespace PatrickRose\AdventOfCode\Days;


class AlchemicalReduction extends AbstractDay
{

    protected function getPuzzleInput(): string
    {
        return '';
    }

    public function getAnswer(bool $partTwo): string
    {
        $input = $this->getPuzzleInput();

        $replacement = $partTwo ? str_split('qwertyuioplkjhgfdsazxcvbnm') : [''];
        $lengthsAfterReplacement = [];

        foreach ($replacement as $toReplace)
        {
            if ($toReplace == '')
            {
                $thisInput = $input;
            }
            else
            {
                $thisInput = str_replace([$toReplace, strtoupper($toReplace)], '', $input);
            }
            while($this->hasReactions($thisInput))
            {
                foreach (str_split('qwertyuioplkjhgfdsazxcvbnm') as $char)
                {
                    $thisInput = str_replace([$char . strtoupper($char), strtoupper($char) . $char], '', $thisInput);
                }
            }
            $lengthsAfterReplacement[] = strlen($thisInput);
        }

        return min($lengthsAfterReplacement);
    }

    private function hasReactions(string $input)
    {
        foreach (str_split('qwertyuioplkjhgfdsazxcvbnm') as $char)
        {
            if (strpos($input, $char . strtoupper($char)) || strpos($input, strtoupper($char) . $char))
            {
                return true;
            }
        }

        return false;
    }
}
